ll,\"dateEvent\":\"2010-08-08\",\"dateEventLocal\":null,\"strDate\":null,\"strTime\":\"00:00:00\",\"strTimeLocal\":null,\"strTVStation\":null,\"idHomeTeam\":\"133610\",\"idAwayTeam\":\"133612\",\"strResult\":\"Manchester United won the match 3–1 with goals from Antonio Valencia, Javier Hernández and Dimitar Berbatov; Chelsea's consolation goal came from Salomon Kalou.[4] It was Manchester United's 14th outright victory in the Community Shield.[5] \",\"strCircuit\":null,\"strCountry\":null,\"strCity\":null,\"strPoster\":\"https:\\/\\/www.thesportsdb.com\\/images\\/media\\/event\\/poster\\/ta7l8x1565439830.jpg\",\"strFanart\":null,\"strThumb\":null,\"strBanner\":null,\"strMap\":null,\"strTweet1\":\"\",\"strTweet2\":\"\",\"strTweet3\":\"\",\"strVideo\":\"\",\"strLocked\":\"unlocked\"},{\"idEvent\":\"610507\",\"idSoccerXML\":null,\"idAPIfootball\":null,\"strEvent\":\"Chelsea vs Man City\",\"strEventAlternate\":\"Man City @ Chelsea\",\"strFilename\":\"FA Community Shield 2012-08-12 Chelsea vs Man City\",\"strSport\":\"Soccer\",\"idLeague\":\"4571\",\"strLeague\":\"FA Community Shield\",\"strSeason\":\"2012\",\"strDescriptionEN\":\"The 2012 FA Community Shield (also known as The FA Community Shield sponsored by McDonald's for sponsorship reasons) was the 90th FA Community Shield, a football match played on 12 August 2012 between the winners of the previous season's Premier League and FA Cup competitions. The match was contested by the 2012 FA Cup winners, Chelsea, and the champions of the 2011–12 Premier League, Manchester City.\\r\\n\\r\\nThe 2012 Community Shield was not played at its usual venue, Wembley Stadium, as the stadium hosted the final of the 2012 Olympic football tournament on the same weekend as the proposed date for the Community Shield. It was played instead at Aston Villa's home ground, Villa Park, in Birmingham. It was the first time since the fixture was played at Maine Road in 1973 that the Community Shield had been hosted at a venue other than Wembley