 Cup. The match was contested by Arsenal, the 2014–15 FA Cup winners, and Chelsea, champions of the 2014–15 Premier League. It was held at Wembley Stadium on 2 August 2015.\",\"strHomeTeam\":\"Arsenal\",\"strAwayTeam\":\"Chelsea\",\"intHomeScore\":\"1\",\"intRound\":\"0\",\"intAwayScore\":\"0\",\"intSpectators\":\"85437\",\"strHomeGoalDetails\":null,\"strHomeRedCards\":null,\"strHomeYellowCards\":null,\"strHomeLineupGoalkeeper\":null,\"strHomeLineupDefense\":null,\"strHomeLineupMidfield\":null,\"strHomeLineupForward\":null,\"strHomeLineupSubstitutes\":null,\"strHomeFormation\":null,\"strAwayRedCards\":null,\"strAwayYellowCards\":null,\"strAwayGoalDetails\":null,\"strAwayLineupGoalkeeper\":null,\"strAwayLineupDefense\":null,\"strAwayLineupMidfield\":null,\"strAwayLineupForward\":null,\"strAwayLineupSubstitutes\":null,\"strAwayFormation\":null,\"intHomeShots\":null,\"intAwayShots\":null,\"dateEvent\":\"2015-08-02\",\"dateEventLocal\":null,\"strDate\":null,\"strTime\":\"00:00:00\",\"strTimeLocal\":null,\"strTVStation\":null,\"idHomeTeam\":\"133604\",\"idAwayTeam\":\"133610\",\"strResult\":\"Watched by a crowd of 85,437 and a television audience of over a million, Arsenal won the match 1–0. \\r\\nThe only goal of the match came near the midway point of the first half; Alex Oxlade-Chamberlain collected a pass from Theo Walcott from the right and scored past Thibaut Courtois. Both managers did not shake hands after the game, which drew media attention. Arsenal's victory was their first against Chelsea in over three years and manager Arsène Wenger's first over José Mourinho in 14 attempts. \",\"strCircuit\":null,\"strCountry\":null,\"strCity\":null,\"strPoster\":\"https:\\/\\/www.thesportsdb.com\\/images\\/media\\/event\\/poster\\/pjjo191565436756.jpg\",\"strFanart\":null,\"strThumb\":null,\"strBanner\":null,\"strMap\":null,\"strTweet1\":\"\",\"strTweet2\":\"\",\"strTweet3\":\"\",\"strVideo\":\"\",\"strLocked\":\"unlocked\"},{\"idEvent\":\"610502\",\"idSoccerXML\":null,\"i